4	4	When I was 8 years old, I was the coolest kid in the class, simple because I had an Amiga back home. Nah, that's not really true. Nobody really knew what Amiga was. All they cared about was football, ice hockey cards and 'who's dad was the strongest'.\r\n\r\nI thought I was cool because I had an Amiga back home. Way much cooler than those with a NES. Though, there was one thing that I did miss with my Amiga and it was Super Mario Bros.\r\n\r\n![Spider boss](http://dl.dropbox.com/u/36465955/r3pl4y/winuae%202012-03-23%2016-25-58-27.png)\r\n\r\nSince life was very cruel to me, my parents wouldn't give me a NES to complement my lack of Super Mario - and so I would have to do with The Great Giana Sisters.\r\n\r\nI love this game. I'm not sure if its due to the lack of Super Mario in my life or if it's a great game. (it does imply its greatness in the title) The graphics are to my taste and the music is truly splendid. I'm not sure if there's a story at all, but it has evil looking hot dogs, bees and strange owls. I'm totally sold.\r\n\r\nHere's a gameplay movie of the first few levels.\r\n<http://www.youtube.com/watch?v=AoI5xDGgAN0>	t	2012-03-24 08:23:56.66143	1615	2012-03-24 08:23:56.662889	2012-03-24 08:23:56.662889	2
7	3	"Another visitor. Stay a while. Stay forever! Muhahaha"\r\n\r\nThat are the introductionary words to one of my youths greatest obsessions, to solve the mystery of Impossible Mission 2.\r\n\r\n![Security is tense](http://dl.dropbox.com/u/36465955/r3pl4y/winuae%202012-03-26%2011-00-32-41.png)\r\n\r\nThe thing about IM2 is that its so rich of information, and of puzzled that you get all befuzzled. You got 3 hours to solve them all, and in your path you find tools as bombs you can use to get past some of the trickier parts.\r\n\r\n![What psycho did come up with this?](http://dl.dropbox.com/u/36465955/r3pl4y/winuae%202012-03-26%2011-01-22-49.png)\r\n\r\nI don't think I ever solved the long mystery of Impossible Mission 2, but it gave me many hours of pleasure looking for clues and opening locked doors with tape recorders.	f	2012-03-26 09:33:29.13165	1807	2012-03-26 09:33:29.133115	2012-03-26 09:33:29.133115	2
8	4	How small can you make a hero? Digital Illusions and Psygnosis are testing the limits in this platformer. This is really one of the cutest games on the Amiga, and it pretty much marks the end of the Amiga for me. It was released the same year as Commodore went bankrupt and we all had to take a few steps back onto the PC platform that was not nearly as ready for gaming.\r\n\r\n![First level](http://dl.dropbox.com/u/36465955/r3pl4y/winuae%202012-03-26%2011-45-55-62.png)\r\n\r\nBenefactor was mostly a puzzle game. You had to figure out in what order to do things in order to complete the levels. I also remember it as a very hard puzzle game. It became hard very fast and I did struggle even at the earliest levels, and if you weren't hardcore platformer, you would get in trouble.\r\n\r\nGraphics are great, and the music is crisp. This is really a masterpiece, and I hope we will see a remake for this to iOS devices some day.	f	2012-03-26 09:59:40.712416	369	2012-03-26 09:59:40.71603	2012-03-26 09:59:40.71603	2
9	5	"Name the color of the white horse of Napoleon"\r\n\r\nI remember the copy protection of Ports of Call as it where yesterday. You would have to look up the fith word in the second paragraph on page 15 of users manual. We had a photo copied version of the manual, so it didn't stop us from playing the game. Nice idea though.\r\n\r\n![Main screen](http://dl.dropbox.com/u/36465955/r3pl4y/Ports_of_Call_2.png)\r\n\r\nShould I start with buying three small crappy boats, or should I go with two large ones? Should I first buy a good boat, and hope it doesn't sink,? This was the strategy game of its time, and we played it alot because you really could play up to 4 players, turn based.\r\n\r\nThis was one of the few games I could play with my dad, that he would enjoy. We could spend the whole afternoon with Ports of Call, and I would always loose.\r\n\r\nFor its time, I would say it was extremely advanced both in terms of strategy game, and graphics. Today the game is available on all kind of devices with 3D graphics and whatnot. Checkout <http://www.portsofcall.de/>	t	2012-03-26 10:19:29.023568	2659	2012-03-26 10:19:29.0271	2012-03-26 10:22:31.533923	2
