58	5	Loom is a strange yet innovative adventure game. In this game you have to use tunes, that you find at different places, and play them on your staff to make things happen. There is no inventory, you have your "spells" instead.\r\n\r\nIt takes a little while to get used to but when you do it's a fabulous game that I haven't seen the likes of in over 20 years.\r\n\r\nThis is a game that should be experienced, not written about.	t	2012-04-13 08:41:20.622753	2156	2012-04-13 08:41:20.69818	2012-04-13 08:41:20.69818	9
59	5	Macro-strategy on a high scale. Starting in the stone age and ending in the 21st century.\r\n\r\nI played this game over and over back in the early 90's trying for all possible different ways to win. One time I left one enemy with one city alive, when he built troops I killed them but left the city and just kept researching. I think I reached future tech 20 before I ended that particular game.	t	2012-04-13 08:45:53.622911	728	2012-04-13 08:45:53.636691	2012-04-13 08:45:53.636691	9
60	3	I discovered this game very late. As a long time fan of Civilization I had a hard time to understand why you couldn't interact with the individual units in the game. At first it seems like a huge disadvantage, but after a time it became the whole interesting point of the game. Could influence citizens of your kingdom, but you couldn't really tell them what to do. They lived their own life.\r\n\r\n![The Settlers](http://dl.dropbox.com/u/36465955/r3pl4y/Settlers-uae.png)\r\n\r\nThe fun part of this game is to build a kingdom. When you got enough resources it is time to go to war with other nations and this is what I find to be the weak part of the game. It was hard to control the skrimishes and to gather your strength at the right place and right moment.\r\n\r\nI've tried many of the sequels, but I've never really found them as compelling as this first game. I am still to try out the iPad version. Hope it is more true to the original than the other sequels have been.	t	2012-04-14 07:19:44.089179	3013	2012-04-14 07:19:44.09022	2012-04-14 07:19:44.09022	2
