62	5	The sequel to the first game, although not in story.\r\n\r\nThis game actually had a fairly decent story for an action game. Besides that it's a solid shooter that brought the genre forward, both in graphics and game play. It also introduced the iconic railgun, a one shot heavy hitter with long reload time.\r\n\r\nThe single player game was well worth playing although most people played multiplayer.\r\n\r\nWell worth playing, even now.	t	2012-04-14 11:47:05.930438	4077	2012-04-14 11:47:05.931157	2012-04-14 11:47:05.931157	9
